import React from "react";

const Chart = (data) => {
  return (
    <div>
      {data.map((x) => {
        return (
          <div
            style={{
              width: `${Math.random() * (100 - 10) + 10}%`,
              height: "20%",
              background: "blue",
            }}
          ></div>
        );
      })}
    </div>
  );
};

export default Chart;
